description:
Somewhere in Middle America, 1907: Maria II, the daughter of an Irish terrorist, meets after the dead of her father Maria I, the singer of a circus. 

She decided to stay with the circus. On her debut as a singer, she accidentally invented strip-tease, that made the circus famous. 

But accidentally they meet an socialist revolutionary and finding themselves leading this revolution against the dictator, the capitalists and the 

church.

